import { Header } from "./components/Header";

function App() {
  return (
    <div className="bg-bg-img h-screen w-screen bg-opacity-100 bg-cover d:bg-contain bg-no-repeat">
      <Header />
      <h1 className="font-bold">Blogs</h1>
    </div>
  );
}

export default App;
